import React, { Component } from 'react';
import '../css/login-page.css';
import LoginForm from './login-form';

class Login extends Component {
    state = {  }
    render() { 
        return (
			<div className='a'>
				<div className='row'>
					<div className='d'>
						<label>Đăng kí</label>
					</div>
					<div className='col-md-2'>
						<label>Đăng nhập</label>
					</div>
				</div>
				<div className='form'>
					<LoginForm/>
				</div>
			</div>
          );
    }
}
 
export default Login;
